import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {
  constructor(private router: Router) {}

  onGetStarted(): void {
    this.router.navigate(['/users']);
  }
}
<div class="homepage-section">
  <h1>Welcome to Master Task Manager</h1>
  <p>My App is a platform designed to help you manage your projects, tasks, teams, and users with ease.</p>
  <button class="get-started-button" (click)="onGetStarted()">Get Started</button>
</div>
